import React from 'react';
import Recipes from './Recipes'
import RecipeView from './RecipeView';


class RecipesToRender extends React.Component{
    render() {
        return (
            <Grid>
                { Recipes.map( item =>
                <RecipeView recipe={item} /> 
                )}
                </Grid>

        )
    }
}

export default RecipesToRender;
